import React from "react";
import { Stack } from "@mui/material";

//util
import { categories } from "../../utils/constants";

const SideBar = () => {
  return (
    <Stack
      sx={{
        overflowY: auto,
        height: { sx: "auto", md: "92vh" },
        flexDirection: { sm: "column", md: "row" },
      }}
    >
      SideBar
    </Stack>
  );
};

export default SideBar;
